INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (7, 10118, 8, 20063115, 2, 5118061, "フリーマーケット会場", 91002, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 40, "青空の下で謁見", 1, 2834, "ペコリーヌとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (7, 10118, 8, 20063115, 2, 5118062, "フリーマーケット会場", 91002, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 40, "未来の騎空団\nマスコット？", 1, 2835, "マホとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (7, 10118, 8, 20063115, 2, 5118063, "ランドソル市街地", 91002, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 40, "お嬢さまからの\n緊急依頼", 1, 2837, "アキノとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 2, 5118064, "フリーマーケット会場", 91002, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 40, "黄金色の悩みごと", 1, 4108402, "ジュンとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 2, 5118065, "フリーマーケット会場", 91002, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 40, "白熱！　格闘大会！", 1, 4107402, "カオリとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (16, 10118, 8, 20063115, 2, 5118066, "オーエド町", 91002, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 40, "祭り太鼓はオーエドの華", 1, 9000227, "ニノンとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (19, 10118, 8, 20063115, 3, 5118067, "フリーマーケット会場", 91002, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 40, "人気者は遅れて\nやってくる", 1, 2101181, "スズナとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 3, 5118068, "ランドソル市街地", 91002, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 40, "巫女・ミーツ・魔法少女", 1, 4109402, "ナナカとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 3, 5118069, "フリーマーケット会場", 91002, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 40, "ネズ耳は二度なくなる", 1, 4305402, "キャル＆コッコロとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 3, 5118070, "ランドソル市街地", 91002, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 40, "この出会いにカンパイ！", 1, 4101402, "ユカリとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (18, 10118, 8, 20063115, 3, 5118071, "ランドソル市街地", 91002, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 40, "陰陽アンサンブル", 1, 4106402, "アオイとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (7, 10118, 8, 20063115, 3, 5118072, "フリーマーケット会場", 91002, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 40, "運試し十番勝負！", 1, 2836, "シノブとの出会い");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (0, 10118, 0, 20063115, 1, 5118600, 0, 0, 0, 0, 0, "彼女たちの新たな日常", 0, 0, "オープニング");
